//현재까지의 종가를 가져오기 위한 모델
struct StockChartResponse: Codable {
    let chart: Chart
}

struct Chart: Codable {
    let result: [Result]
}

struct Result: Codable {
    let meta: Meta
    let timestamp: [Int]
    let indicators: Indicators
}

struct Meta: Codable {
    let currency: String
    let symbol: String
    let exchangeName: String
    let instrumentType: String
    let firstTradeDate: Int
    let regularMarketTime: Int
    let gmtoffset: Int
    let timezone: String
    let exchangeTimezoneName: String
    let regularMarketPrice: Double
    let chartPreviousClose: Double
//    let previousClose: Double
//    let scale: Int
    let priceHint: Int
    let currentTradingPeriod: TradingPeriod
//    let tradingPeriods: [[Period]]
    let dataGranularity: String
    let range: String
    let validRanges: [String]
}

struct TradingPeriod: Codable {
    let pre: Period
    let regular: Period
    let post: Period
}

struct Period: Codable {
    let timezone: String
    let start: Int
    let end: Int
    let gmtoffset: Int
}

struct Indicators: Codable {
    let quote: [Quote]
}

struct Quote: Codable {
    let open: [Double?]
    let high: [Double?]
    let close: [Double?]
    let low: [Double?]
    let volume: [Int?]
}



